import React, { useContext } from 'react';
import AccountNav from '../layout/AccountNav';
import UserContext from '../../context/userContext';

const { user, setUser } = useContext(UserContext);
const { name } = user;

const checking = (max = 0, min = 0) => {
  return Math.random() * (max - min) + min;
};

const saving = (max = 0, min = 0) => {
  return Math.random() * (max - min) + min;
};

const total = Math.round(checking(10000)) + Math.round(saving(10000));

export const Account = () => {
  return (
    <div>
      <AccountNav />
      <div className='container'>
        <div class='jumbotron'>
          <h1 class='display-4'>Welcome {name}!</h1>
          <p class='lead'>Make a deposit or withdraw from you accounts.</p>
        </div>
        <h1>Account Balance - ${total}</h1>
      </div>
    </div>
  );
};

export default Account;
